import React from "react";
import { Box, Typography, Grid, Button ,makeStyles } from "@material-ui/core";

const skills = ["Javascript", "React.js", "Node.js"];

const useStyles = makeStyles({
    wrapper:{
        border: '1px solid #e8e8e8'
    }
})
export default (props) => {
    const classes = useStyles();
  return (
    <Box className={classes.wrapper}>
      <Grid container>
        <Grid item xs>
          <Typography variant="subtitle 1">Frontend Dev</Typography>
          <Typography variant="subtitle2">Google</Typography>
        </Grid>
        <Grid item container xs>
          {skills.map((skill) => (
            <Grid key={skill} item>
              {skill}
            </Grid>
          ))}
        </Grid>
         
        <Grid item xs container direction="column" alignItems="flex-end">
          <Grid item>
            <Typography variant="caption">
              2577 min ago | Full time | Remote
            </Typography>
          </Grid>
          <Grid item>
            <Box mt={2}>
              <Button variant="outlined">Check</Button>
            </Box>
          </Grid> 
        </Grid>
      </Grid>
    </Box>
  );
};
